const myImage = new Image();
myImage.src = 'data:image/png;base64,';

myImage.addEventListener('load',()=>{
    const canvas = document.getElementById('canvas');
    const ctx = canvas.getContext('2d')
    canvas.width = 360;
    canvas.height = 450;
    
    // imagen procesada en base64
    ctx.drawImage(myImage,0,0,canvas.width,canvas.height);
    //informacion de cada pixel de la imagen en forma de matriz
    const pixels = ctx.getImageData(0,0,canvas.width,canvas.height);
    //borro la imagen ya que la info esta depositada en pixels
    ctx.clearRect(0,0,canvas.width,canvas.height);

    // variables
    let particlesArray = [];
    const numOfParticles = 5000;
    let mappedImg = [];
    // Descompongo la informacion de color de cada pixel
    for(let y = 0; y < canvas.height; y++){
        let row = [];
        for(let x = 0; x < canvas.width; x++){
            const red = pixels.data[(y*4*pixels.width) + (x*4)];
            const green = pixels.data[(y*4*pixels.width) + (x*4+1)];
            const blue = pixels.data[(y*4*pixels.width) + (x*4+2)];
            const brightness = calculateRelativeBrightness(red,green,blue);
            const cell = [
                cellBrightness = brightness,
                //si quiero que la imagen mantenga los mismos colores agrego
                cellColor = `rgb(${red},${green},${blue})`
            ];
            row.push(cell);
        }
        mappedImg.push(row);
    }

    // calculo el brillo relativo de cada pixel
    function calculateRelativeBrightness(red,green,blue){
        return Math.sqrt(
            (red*red)*0.299 +
            (green * green) * 0.587 +
            (blue * blue) * 0.114
        )/100;
    }
    class Particle{
        constructor(){
            this.x = Math.random() * canvas.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 2.5;
            this.size = Math.random() + .5;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
        }
        //actualiza la posicion de cada particula
        update(){
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = mappedImg[this.position1][this.position2][0];
            let movement = (2 - this.speed* 0.8) + this.velocity;

            this.y += movement;
            if(this.y >= canvas.height){
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
        }
        //dibuja cada particula
        draw(){
            ctx.beginPath();
            ctx.fillStyle = mappedImg[this.position1][this.position2][1];
            ctx.arc(this.x,this.y,this.size,0,Math.PI * 2);
            ctx.fill();
        }
    }

    function init(){
        for(let i = 0; i < numOfParticles; i++){
            particlesArray.push(new Particle);
        }
    }
    init();

    function animate(){
        requestAnimationFrame(animate);
        
        ctx.globalAlpha = 0.08;
        ctx.fillStyle = 'rgb(0,0,0)';
        ctx.fillRect(0,0,canvas.width,canvas.height);
        ctx.globalAlpha = 0.1;
        for(let i = 0; i < particlesArray.length; i++){
            particlesArray[i].update();
            ctx.globalAlpha = particlesArray[i].speed * .5;
            particlesArray[i].draw();
        }
    }
    animate();
})